<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Touride - La Union Tourist Spots</title>
    <script src="https://cdn.tailwindcss.com"></script>
    
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.2/css/all.min.css" integrity="sha512-SnH5WK+bZxgPHs44uWIX+LLMDJdZ5xJpXwUv4hBvFjT8G7fI91m6T72Q50w9I/u76b5a3zE3+xN+y2jA1yD2Q==" crossorigin="anonymous" referrerpolicy="no-referrer" />
    
    <style>
        .map-iframe {
            object-fit: contain; 
            max-width: 100%;
            max-height: 100%;
        }

        .pin-base {
            position: relative;
            width: 30px; 
            height: 40px; 
            z-index: 10;
        }

        .pin-icon {
            font-size: 35px; 
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -100%); 
            color: black; 
            text-shadow: 
                -1px -1px 0 white,  
                1px -1px 0 white,
                -1px 1px 0 white,
                1px 1px 0 white; 
        }

        .pin-hover-label {
            z-index: 20;
        }

        /* Tooltip */
        #tooltip {
            position: absolute;
            background: rgba(0,0,0,0.8);
            color: #fff;
            padding: 4px 8px;
            border-radius: 4px;
            font-size: 12px;
            pointer-events: none;
            display: none;
            white-space: nowrap;
            z-index: 100;
        }

        svg {
            max-width: 100%;
            height: auto;
            display: block;
            margin: 0 auto;
            background-color: #e0f2f1;
        }

        .hover-group path {
            fill: #f4c0c7; 
            stroke: #000;
            stroke-width: 0.4;
            cursor: pointer;
            transition: fill 0.2s;
        }

        .hover-group path:hover,
        .hover-group text:hover {
            fill: #ff6b81; 
        }

        .hover-group text {
            font-family: 'Tahoma';
            font-size: 12px;
            pointer-events: all;
            cursor: pointer;
            fill: #000;
        }
    </style>
</head>
<body class="bg-gray-100 min-h-screen flex flex-col items-center justify-center p-6">

    <h1 class="text-3xl font-bold mb-6 text-blue-700">Explore La Union</h1>
    <p class="text-gray-600 mb-8 text-center max-w-xl">
        Click a destination on the map below to discover its most popular attractions.
    </p>

    <div id="map" class="relative w-full max-w-4xl h-[550px] rounded-2xl shadow-xl border border-blue-300 overflow-hidden flex justify-center items-center">
        
        <img src="../assets/img/la_union.png" alt="La Union Map" class="map-iframe"/>

        <!-- Pins -->
        <div class="absolute top-[42%] left-[43%] transform -translate-x-1/2 -translate-y-1/2 cursor-pointer group" data-city="San Fernando City">
            <div class="pin-base">
                <i class="fas fa-map-marker-alt pin-icon text-red-600 animate-pulse"></i>
            </div>
            <span class="pin-hover-label absolute left-8 top-0 bg-white text-xs rounded px-2 py-1 shadow opacity-0 group-hover:opacity-100 transition">
                San Fernando City
            </span>
        </div>

        <div class="absolute top-[52%] left-[52%] transform -translate-x-1/2 -translate-y-1/2 cursor-pointer group" data-city="San Juan">
            <div class="pin-base">
                <i class="fas fa-map-marker-alt pin-icon text-green-600 animate-pulse"></i>
            </div>
            <span class="pin-hover-label absolute left-8 top-0 bg-white text-xs rounded px-2 py-1 shadow opacity-0 group-hover:opacity-100 transition">
                San Juan
            </span>
        </div>

        <div class="absolute top-[10%] left-[45%] transform -translate-x-1/2 -translate-y-1/2 cursor-pointer group" data-city="Luna">
            <div class="pin-base">
                <i class="fas fa-map-marker-alt pin-icon text-yellow-600 animate-pulse"></i>
            </div>
            <span class="pin-hover-label absolute left-8 top-0 bg-white text-xs rounded px-2 py-1 shadow opacity-0 group-hover:opacity-100 transition">
                Luna
            </span>
        </div>

        <div class="absolute top-[15%] left-[44%] transform -translate-x-1/2 -translate-y-1/2 cursor-pointer group" data-city="Bangar">
            <div class="pin-base">
                <i class="fas fa-map-marker-alt pin-icon text-purple-600 animate-pulse"></i>
            </div>
            <span class="pin-hover-label absolute left-8 top-0 bg-white text-xs rounded px-2 py-1 shadow opacity-0 group-hover:opacity-100 transition">
                Bangar
            </span>
        </div>

    </div>

    <!-- Info card -->
    <div id="infoCard" class="hidden mt-8 bg-white rounded-xl shadow-xl p-6 max-w-lg w-full border border-gray-200">
        <h2 id="cityName" class="text-2xl font-semibold text-blue-700 mb-4"></h2>
        <ul id="placesList" class="list-disc pl-5 text-gray-700 space-y-1"></ul>
        <button id="closeCard" class="mt-6 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">
            Close
        </button>
    </div>

