    <script>
  const destinations = {
    "San Fernando City": ["Ma-Cho Temple", "Halo-Halo de Iloko", "Poro Point Lighthouse", "Christ the Redeemer Statue"],
    "San Juan": ["Urbiztondo Surfing Beach", "Flotsam and Jetsam Hostel", "El Union Coffee", "The Great Northwest Travel Stop"],
    "Luna": ["Luna Pebble Beach", "Baluarte Watch Tower", "Namacpacan Church"],
    "Bangar": ["Bangar Public Market", "Bangar Church", "Bangar River Park", "Local Street Food Spots"],
    "Sudipen": ["Sudipen Falls", "Sudipen Church", "Local Market", "Mount Burot Trails"],
    "Bauang": ["Bauang Beach", "Bauang Church", "Bauang Public Market", "Surfing Spots"],
    "San Gabriel": ["San Gabriel Church", "San Gabriel Falls", "Rice Terraces", "Local Food Stalls"],
    "Aringay": ["Aringay Church", "Aringay Bay", "Local Handicrafts", "Mangrove Area"],
    "Caba": ["Caba Church", "Caba Museum", "Local Beaches", "Farm Tours"],
    "Naguilian": ["Naguilian Church", "Naguilian Falls", "Local Market", "Scenic Viewpoints"],
    "Bagulin": ["Bagulin Church", "Baluarte Viewpoint", "Hiking Trails", "Rice Terraces"],
    "Burgos": ["Burgos Church", "Burgos Beach", "Local Market", "Nature Trails"],
    "Bacnotan": ["Bacnotan Beach", "Bacnotan Church", "Surfing Spots", "Local Market"],
    "Agoo": ["Agoo Church", "Agoo River Park", "Local Beaches", "Heritage Sites"],
    "Tubao": ["Tubao Church", "Tubao Falls", "Local Markets", "Mountainside Views"],
    "Pugo": ["Pugo Adventure Park", "Pugo Church", "Hiking Trails", "Waterfalls"],
    "Santo Tomas": ["Santo Tomas Church", "Scenic Viewpoints", "Local Hiking Trails", "Rivers"],
    "Santol": ["Santol Church", "Local Hiking Trails", "Scenic Views", "Rivers"],
    "Rosario": ["Rosario Church", "Local Beaches", "Historic Sites", "Mangrove Areas"],
    "Balaoan": ["Balaoan Church", "Balaoan Beach", "Local Public Market", "Balaoan Falls"]
};




        const mapContainer = document.getElementById("map");
        const infoCard = document.getElementById("infoCard");
        const cityName = document.getElementById("cityName");
        const placesList = document.getElementById("placesList");
        const closeCard = document.getElementById("closeCard");

        // Click on pins
        mapContainer.addEventListener("click", (e) => {
            const cityElement = e.target.closest("[data-city]");
            if (!cityElement) return;
            const city = cityElement.dataset.city;
            cityName.textContent = city;
            placesList.innerHTML = "";
            destinations[city].forEach(place => {
                const li = document.createElement("li");
                li.textContent = place;
                placesList.appendChild(li);
            });
            infoCard.classList.remove("hidden");
            infoCard.scrollIntoView({ behavior: "smooth" });
        });

        closeCard.addEventListener("click", () => {
            infoCard.classList.add("hidden");
        });

        // Click on SVG hover regions
        document.querySelectorAll('.hover-group').forEach(group => {
            group.addEventListener('click', () => {
                const city = group.getAttribute('data-tooltip');
                if (!destinations[city]) return;
                cityName.textContent = city;
                placesList.innerHTML = "";
                destinations[city].forEach(place => {
                    const li = document.createElement("li");
                    li.textContent = place;
                    placesList.appendChild(li);
                });
                infoCard.classList.remove("hidden");
                infoCard.scrollIntoView({ behavior: "smooth" });
            });

            group.addEventListener('mousemove', (e) => {
                const text = group.getAttribute('data-tooltip');
                const tooltip = document.getElementById('tooltip');
                tooltip.style.display = 'block';
                tooltip.innerText = text;
                tooltip.style.left = e.pageX + 10 + 'px';
                tooltip.style.top = e.pageY + 10 + 'px';
            });

            group.addEventListener('mouseleave', () => {
                const tooltip = document.getElementById('tooltip');
                tooltip.style.display = 'none';
            });
        });
    </script>

